import React from 'react';
import { Title, Text } from './style';
interface Props{
    title: string;
    text:string;

  }

const Projeto:React.FC<Props> = ({title = "teste", text = "Apenas mais um dia"}) =>{
    return (  
        <div>
           <Title>
                {title}
           </Title>
           <Text>
                {text}
           </Text>

        </div>
    );
}

export default Projeto;
